import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a search to be possible (search input and button)
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Enter a search term and trigger search (to show products and sort/filter controls)
    await page.fill('#searchInput', 'iphone');
    await page.click('.search-btn');

    // Wait for the sort/filter controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Wait for the sort select to be available
    await page.waitForSelector('select#sortSelect', { timeout: 5000 });

    // Select "Price: Low to High" option
    await page.selectOption('select#sortSelect', 'price-low');

    // Wait for the products to be sorted (wait for a small UI update)
    await page.waitForTimeout(500);

    // Take screenshot after applying price sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sort_applied.png'));

    // Extract the titles and prices of the first 3 products to verify sorting
    const products = await page.$$eval(
      '.products-grid .product-card, .products-list .product-card-list',
      nodes => nodes.slice(0, 3).map(node => {
        const title = node.querySelector('.product-title')?.innerText || '';
        const priceText = node.querySelector('.product-price')?.innerText || '';
        // Extract price as float
        const match = priceText.match(/\$([0-9,.]+)/);
        const price = match ? parseFloat(match[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    return {
      success: true,
      action: "Applied price sort filter (Price: Low to High) on search results",
      extractedData: {
        firstThreeProducts: products
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
